import React, { useEffect } from "react";
function Index() {
  useEffect(() => {
    fetch("api/getData").then(async (r) => {
      const json = await r.json();
      console.log("json:", json);
    });
  }, []);

  return <div>Hey</div>;
}

export default Index;
